		"id_str": "1216492793696141313",
		"full_text": "\"자신은 남들(적어도 여성)보다 당연히 더 많은 걸 누려야 하는데 사회가 점점 평등해진다면, 이들은 자신이 부당하게 박해를 받는다고 느낀다. 그 결과 마치 남들이 자신에게 빚이라도 진 것처럼 맡겨놓은 대접과 인정 내놓으라며 떼를 쓴다. ‘왜 대단한 나를 알아주지 않느냐’며 사람들을 괴롭힌다.\"",
