		"id_str": "1216492780471513088",
		"full_text": "\"특히 나는 남들과 달리 특별하며 따라서 좋은 대접을 받을 자격이 있다고 하는 나르시시즘의 자격의식과 공격성 사이에 깊은 관계가 있다. 한마디로 말하면 그간 너무 ‘우쭈쭈’ 받고 살아와서 현실감 없이 자기가 진짜 대단한 존재라고 생각할 때, 쉽게 무시당했다 느끼고 공격성을 표출한다.\"",
