		"id_str": "1216162056774176770",
		"full_text": "뭐 서구 시장이나 농업환경이 유토피아라는 말은 아니다. 그늘도 많고 세계 어딜가나 농업은 각광받는 직업이 아니며... 하지만 적어도 제정신이다...전세계에서 오로지 한국과 일본만 농산물을 공산품처럼 다룬다. 농산물에 특상중하 매기고 당도측정해서 그람단위 개수별 포장으로 파는 미친 나라.",
