		"full_text": "믿을 수가 없는 광경의 연속이다... 사진은 네덜란드 공판장 블랙라벨(프리미엄)당근. 손가락굵기의 크기가 들쭉날쭉한 당근들을 벌크로 거래한다. 한국의 어떤 미친 농부가 콘테나에 비닐 한장 씌워 손가락만한 당근을 출하하나. 국내에선 불법이다. 유통업자와 소비자와 정부는 이 꼴 절대 못본다... https://t.co/QkVvjlJ9L0",
