		"text": "농산물 대한 단조로운 평가기준이 단조로운 농산물시장을 만들고 농부들은 그 수요에 맞게 공급해야되니 \"단일품종+농약비료과잉시비+과잉생산 후 극소량 선별출하\"하게 되고 소비자 입장에서는 비싼돈주고 형편없는 농산물(가공품 포함)먹는다. 이런 얘기가 나오는 것..."
