		"full_text": "생과 경쟁하면 당연히 한국이 압승이지만... 조리나 요리, 착즙, 베이커리 등 가공을 거쳐야 할때는 한국 과일품종의 단조로움이 큰 독이 된다. 수분이 많고 단맛밖에 없는 과일은 잘 짜봐야 내맛도니맛도 아닌 단물, 아무리 졸여봐야 아무짝에 쓸모없는 스프같은 질감의 단 국물 같은 것이 나옴...",
