		"full_text": "백날 쪼그려앉는 식당에서 쏘주마시면서 돈 벌어서 룸싸롱가는걸 성공의 기준으로 여기는 문화. 이게 교육수준, 직업의 중요성, 소득 차이에 상관없이 일관되게 공유되는 걸 내가 거쳐온 수 많은 조직에서 느꼈다. 이에 동조하지 않은 구성원의 존재는 자신들이 외면한 저열함을 비추는 적이 된다.",
