		"text": "유투브채널 추천. 스웨덴 자연인이 사계절 홀로 하이킹하고 캠핑하는 내용임. 혼자 다니기에 대사나 말이 거의 없고 걍 사계절이 담긴 아름다운 풍경과 바람소리, 빗소리, 모닥불소리, 눈 밟는 소리 등등이라 ASMR로 매우 좋고 시각적으로로 만족스럽다. https://t.co/Muiymaexrf"
