		"text": "대구 지역 백화점 전쟁은 결국 대구신세계가 완전히 주도하는 모양새. 이번에 8천억원 달성에 실패했지만 롯데 대구점과 대백프라자의 명품 브랜드를 거의 다 흡수한 상태. 현대 대구점이 그나마 명품 라인업을 거의 안뺏기고 매장도 적은 편이 아니라서 손해안보고 잘 버티고 있는 중. https://t.co/KU6q73wHJS"
