		"text": "멜론 밖 네이버에서 검색해보았다\n13일 18시 음원공개, 14일 00시 차트 1위를 멜론차트 1위를 기록했지만 ‘이 번호로 전화해줘’는 급상승 검색어에 오른적도 없음\n‘바이브’는 3일후인 16일 새벽 1시47분에 급상승 검색어 4위에 오름\n이유는 한 음악방송에 나왔기 때문이었음 https://t.co/mtax5ZdDlt"
