		"text": "“우리는 공통점 때문에 친해지고 차이점 때문에 성장한다.” \n\n오래 전에 했던 메모들을 보다가 발견한 심리학자 사티어의 문장이다. 때를 따라 만나는 관계들이 나를 더욱 다정하게도 하고, 충돌 속에서 성장하게도 한다는 것. 더 나아가 차이점을 인정하고 있는 그대로 수용하는 것은 성숙이겠다."
